import axios from "axios";
import React, { useEffect, useState } from "react";

const SHEET_ID = "1yj1oGvm7JOjNskcnmgFxwVWFZ4O1mvH_SrFNXwxa-Ok";
const SHEET_NAME = "Sheet1";
const API_KEY = "AIzaSyAC511tUxujeEh1TkYVejr3HozvJkiaZ-8"; // Replace with your actual API key, preferably from an environment variable

const styles = {
  container: {
    padding: "20px",
    maxWidth: "800px",
    margin: "0 auto",
  },
  title: {
    fontSize: "24px",
    fontWeight: "bold",
    marginBottom: "10px",
  },
  description: {
    marginBottom: "20px",
  },
  error: {
    color: "red",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginTop: "20px",
  },
  th: {
    border: "1px solid #ddd",
    padding: "8px",
    textAlign: "left",
    backgroundColor: "#f2f2f2",
    position: "sticky",
    top: 0,
  },
  td: {
    border: "1px solid #ddd",
    padding: "8px",
  },
  card: {
    border: "1px solid #ddd",
    borderRadius: "4px",
    padding: "10px",
    marginBottom: "10px",
  },
  cardHeader: {
    fontWeight: "bold",
    marginBottom: "5px",
  },
};

const Hard: React.FC = () => {
  const [data, setData] = useState<any[][]>([]);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `https://sheets.googleapis.com/v4/spreadsheets/${SHEET_ID}/values/${SHEET_NAME}?key=${API_KEY}`
        );
        if (response.data && response.data.values) {
          setData(response.data.values);
        } else {
          setError("No data received from the API");
        }
      } catch (error) {
        console.error("Error fetching data:", error);
        if (axios.isAxiosError(error)) {
          setError(
            `Error: ${error.response?.status} - ${
              error.response?.data?.error?.message || error.message
            }`
          );
        } else {
          setError("An unexpected error occurred");
        }
      }
    };

    fetchData();
  }, []);

  const headers = [
    "User",
    "Day #",
    "Date",
    "Rating?",
    "Exercise",
    "Protein?",
    "Water?",
    "Daily Reflection",
  ];

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>75 Hard</h2>
      <p style={styles.description}>
        This is a challenge that I am doing to improve my mental toughness and
        discipline.
      </p>
      {error ? (
        <p style={styles.error}>{error}</p>
      ) : data.length > 0 ? (
        <>
          {/* Desktop view */}
          <div className="desktop-view" style={{ overflowX: "auto" }}>
            <table style={styles.table}>
              <thead>
                <tr>
                  {headers.map((header, index) => (
                    <th key={index} style={styles.th}>
                      {header}
                    </th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {data.slice(1).map((row, rowIndex) => (
                  <tr key={rowIndex}>
                    {row.map((cell, cellIndex) => (
                      <td key={cellIndex} style={styles.td}>
                        {cell}
                      </td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          {/* Mobile view */}
          <div className="mobile-view">
            {data.slice(1).map((row, rowIndex) => (
              <div key={rowIndex} style={styles.card}>
                <div style={styles.cardHeader}>
                  {row[0]} - Day {row[1]}
                </div>
                <p>
                  <strong>Date:</strong> {row[2]}
                </p>
                <p>
                  <strong>Rating:</strong> {row[3]}
                </p>
                <p>
                  <strong>Exercise:</strong> {row[4]}
                </p>
                <p>
                  <strong>Protein:</strong> {row[5]}
                </p>
                <p>
                  <strong>Water:</strong> {row[6]}
                </p>
                <p>
                  <strong>Reflection:</strong> {row[7]}
                </p>
              </div>
            ))}
          </div>
        </>
      ) : (
        <p>Loading data...</p>
      )}
    </div>
  );
};

export default Hard;
